  true,\n\t\"url\": null,\n\t\"notes\": \"This shapefile containing 50 meter height
  data has been validated by NREL and wind energy meteorological consultants. However,
  the data is not suitable for micro-siting potential development projects. The shapefile
  was generated from a raster dataset with a 200 m resolution,0 in a UTM zone 12,
  datum WGS 84 projection system.rnrnThe [SWERA Programme](http://en.openei.org/apps/SWERA/
  \"SWERA Interactive Web Portal\") provides easy access to high quality renewable
  energy resource information and data to users all around the world. Its goal is
  to help facilitate renewable energy policy and investment by making high quality
  information freely available to key user groups. SWERA products include Geographic
  Information Systems (GIS) and time series data, along with links to energy optimization
  tools needed to apply these data.rnrn*Note* - In order to ensure the downloadable
  shapefile is current, please compare the date updated on this page to the last updated
  date on the [NREL GIS Wind Data](http://www.nrel.gov/gis/data_international.html
  \"NREL GIS Wind Data webpage\") webpage.rn\",\n\t\"license_title\": \"Creative Commons
